import logo from './logo.svg';
import './App.css';
import CollegeList from './components/CollegeList';
import FilterBar from './components/FilterBar';

function App() {
  return (
    <div className="App">
      <FilterBar></FilterBar>
      <div className="list">
        <CollegeList></CollegeList>
      </div>
    </div>
  );
}

export default App;
